import React from 'react';
import './App.css';

function App() {
  let url = 'http://localhost:8000/user/'
const data = fetch(url)
  .then(response => response.json())
  .then(data => console.log(data))
  .catch(error => console.error(error));
  return (
    <div className="App">

    </div>
  );
}

export default App;
